import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../../Logo/Logo';

const NavLogo = props => {

  const logoStyles = {
    width: "auto", 
    height: "50px", 
    display: "block"
  }

  return(

    <Link
      to="/"
      className="NavLogo__anchor"
      onClick={props.onClick}>
        <Logo 
          className="NavLogo__image"
          style={logoStyles}
        />
    </Link>
  )
}

export default NavLogo;
